import React from 'react';
import MainLayout from '../../../layouts/MainLayout';
import getData from '../../../utils/graphQLClient';

export default function LaunchPage({ launch }) {
  console.log(launch);
  return (
    <MainLayout>
      <div>Launch</div>
    </MainLayout>
  );
}

export async function getServerSideProps(context) {
  const { store, query, req } = context;

  const { data, errors } = await getData(`{
    launch(id: "5eb87cd9ffd86e000604b32a") {
      id
      flight_number
      name
      success
      details
      date_unix
    }
  }`);

  //   console.log(response);
  return {
    props: { launch: data }, // will be passed to the page component as props
  };
}
